import React, { Component } from "react";

class CartIcon extends Component {
  state = {};
  render() {
    return (
      <div className="carticon">
        <img
          src="data:image/png;base64,"
          alt="cart"
        />
        <span className="carticon__badge">{this.props.numItemsatc}</span>
      </div>
    );
  }
}

export default CartIcon;
